                        onSuccess: function (result) {
                            result.image.data = toBase64(result, false, "MANUAL", captureOrientation);
                            onManualCaptureCallback.onCropped(result);
                        },

                        onFail: function () {
                            onManualCaptureCallback.onCropped(null);
                        }
